import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for at least one product price to be visible
    // Try .product-price (from the CSS)
    await page.waitForSelector('.product-price', { timeout: 5000 });

    // Extract all product prices (including both current and original prices)
    const prices = await page.$$eval('.product-price', nodes =>
      nodes.map(node => {
        // Get main price
        const mainPrice = node.childNodes[0]?.textContent?.replace(/[^0-9\.,]/g, '').trim();
        // Try to get original price if present
        const original = node.querySelector('.original-price');
        const originalPrice = original ? original.textContent.replace(/[^0-9\.,]/g, '').trim() : null;
        return {
          mainPrice,
          originalPrice
        };
      })
    );

    // Take screenshot of the product prices area (first .product-price)
    const firstPrice = await page.$('.product-price');
    if (firstPrice) {
      await firstPrice.screenshot({ path: path.join(screenshotsDir, 'step_2_first_product_price.png') });
      screenshots.push(path.join(screenshotsDir, 'step_2_first_product_price.png'));
    }

    return {
      success: true,
      action: "Extracted all product prices from the page",
      extractedData: {
        prices
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
